def opt_sieve(n):
    prime=[]
    is_prime = [True for i in range(n)] 
    spf=[0 for i in range(n)]
    is_prime[0]=is_prime[1]=False
    for i in range(2,n):
        if is_prime[i]:
            spf[i]=i
            prime.append(i)
        j=0
        while j<len(prime) and i*prime[j]<n and prime[j]<=spf[i]:
            is_prime[i*prime[j]]=False
            spf[i*prime[j]]=prime[j]
            j+=1
    return is_prime

